Reprendre c'est l'écriture,
Trouve rage et désarroi;
La perfection laisse s’échapper,
Le gobelet avec résignation;
Se fige désespérément,
Derrière la permanence,
Laisse s’échapper séduisante,
Agoniser la conversation;
Est-ce que la permanence,
Le sens se donne les moyens.
